import { BrowserRouter, Route, Link } from 'react-router-dom';
import LivroLista from './LivroLista';
import LivroDados from './LivroDados';
import 'bootstrap/dist/css/bootstrap.min.css';

function App(){
  return (
    <BrowserRouter>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container-fluid">
          <Link className="navbar-brand" to="/">Livros</Link>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav">
              <li className="nav-item">
                <Link className="nav-link" to="/">Lista</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/livro-dados">Dados</Link>
              </li>
            </ul>
          </div>
        </div>
      </nav>
      <div className="container">
        <Route exact path="/" component={LivroLista} />
        <Route path="/livro-dados" component={LivroDados} />
      </div>
    </BrowserRouter>
  );

}



export default App;
